import { keepPreviousData, useQuery } from "@tanstack/react-query";
import axios from "axios";

interface UserList {
  id: number;
  name: string;
  username: string;
  email: string;
  address: {
    street: string;
    suite: string;
    city: string;
    zipcode: string;
    geo: {
      lat: string;
      lng: string;
    };
  };
  phone: string;
  website: string;
  company: {
    name: string;
    catchPhrase: string;
    bs: string;
  };
}

function fetchUsers() {
  return axios
    .get("https://jsonplaceholder.typicode.com/users")
    .then((res) => res.data);
}
function UserList() {
  const { data, isLoading, error } = useQuery(["users"], () => fetchUsers(), {
    keepPreviousData: true,
  });
  if (isLoading) return <p>≈Åadowanie danych...</p>;
  if (error) return <p>Error: {error.message}</p>;
  return <div></div>;
}

const Map: React.FC = () => {
  return (
    <div className="p-8 bg-gray-200 flex flex-col md:flex-row shadow-xl rounded-lg space-x-4"></div>
  );
};

export default Map;
